  return <div>

    <form action="">
    <h2>Calculadora</h2>


    <Input
    type={"number"}
    placeholder={"Insira um número:"}
    name={"input1"}
    id={"number1"}
    />
    <Input
    type={"number"}
    placeholder={"Insira um número:"}
    name={"input2"}
    id={"number2"}
    />

    <Button
    text={"Calcular"}
    type={"submit"}/>
      


    </form>


  </div>;
};

export default Tests;
